import React from 'react';

function Welcome() {
  return (
    <div className='helloPage'>
      {/* Контейнер для текста на одной линии */}
      <div className='textContainer'>
        {/* Блок с большим текстом */}
        <div className='largeText'>
          <h2>Домакот – питомец под присмотром,<br/>пока вы на работе</h2>
        </div>

        {/* Блок с меньшим текстом */}
        <div className='smallText'>
          <p>Продуктом проекта «Домакот» является <br/> комплексная система видеонаблюдения и<br/>
            аналитики для мониторинга <br/> домашних животных <br/> (кошек и собак). </p>
        </div>
      </div>

      {/* Блок с наложенными изображениями */}
      <div className='overlappingImages'>
        <img src='/hands_2.png' alt='Руки в форме сердца' className='photo hands' />
        <img src='/pets.png' alt='Фото питомцев' className='photo pets' />
      </div>
    </div>
  );
}

export default Welcome;
